import React from 'react';
import './Home.css';
import { Link } from 'react-router-dom';

function Home(){
    return (
        <>
            <ul class="menu">
                <li tabindex="3">
                    <Link to="/workout">
                        <i class="fa-solid fa-dumbbell"></i>
                    </Link>
                </li>
                <li tabindex="2">
                    <a href="../profile/profile.html"><i class="fa-solid fa-user"></i></a>
                </li>
            </ul>
            <ul class="menu_2">
                <li tabindex="1">
                    <a class="active" href="../home/home.html"><i class="fa-solid fa-house"></i></a>
                </li>
                <li tabindex="4" style={{float: "right"}}>
                    <a href="../index.html">Log out</a>
                </li>
            </ul>
        </>
    );
}

export default Home;
